import React from 'react';
import styled from 'styled-components';
import LoginContent from '../components/LoginContent';
import Nav from '../components/Nav';


const HomeWrapper = styled.section`
    width: 100vw;
    height: 100vh;
    background: url();
`;


export const Home = () => {
    return (
        <div>
            <Nav></Nav>
            <LoginContent></LoginContent>
        </div>
    )
}
